  /* -------------------------------
  Lightbox handling functions:
  1. on CLicking the Gallery Image it will go to the next image. If at the last image it will go to the first image.
  ---------------------------------- */

  handleOpenLightbox(index, event) {
    event.preventDefault();
    this.setState({
      currentImage: index,
      lightboxIsOpen: true
    });
  }
  handleCloseLightbox() {
    this.setState({
      lightboxIsOpen: false
    });
  }
  handleGotoPrevious() {
    this.setState({
      currentImage: this.state.currentImage - 1
    });
  }
  handleGotoNext() {
    this.setState({
      currentImage: this.state.currentImage + 1
    });
  }
  handleGotoImage(index) {
    this.setState({
      currentImage: index
    });
  }
  handleClickImage() {
    if (this.state.currentImage === this.props.images.length - 1) {
      return;
    }
    this.handleGotoNext();
  }
  handleThumbnail(index) {
    this.setState({
      currentImage: this.props.images[index]
    });
  }

  /* ----------------------
      To render experience
      -------------------- */
  handleExperience(chronic) {
    const expList = [];
    let keyVal = 0;
    /*     ExpList.push(<div>); */
    if (chronic) {
      for (let count = 0; count <= chronic.length - 1; count++) {
        if (chronic[count].timeinYrs && chronic[count].timeinYrs > 0) {
          const bullList = [];
          // For (let listCount = 0; listCount <= chronic[count].categs.length - 1; listCount++) {
          bullList.push(<li key={keyVal++}>{chronic[count].categs}</li>);
          // }
          expList.push(
            <p key={keyVal++} className="subText">{chronic[count].timeinYrs}&nbsp;<span>yrs</span>&nbsp;</p>);
          expList.push(
            <span key={keyVal++} className="bold-font-family">{chronic[count].role}</span>);
          expList.push(
            <ul key={keyVal++} className="circle-dot-list">
              {bullList}
            </ul>);
        }

        if (count < chronic.length - 1) {
          expList.push(<div key={keyVal++} className="clear-both"/>);
        }
      }
    }
    /*     ExpList.push(</div>); */
    return (expList);
  }

  /* ------------------------------------------------
    To display the Badges under the profile Punchline
    ------------------------------------------------- */
  handleBadges(e) {
    let keyarr = 0;
    const imgArr = [];
    if (e) {
      for (let counter = 0; counter <= e.length - 1; counter++) {
        imgArr.push(<img key={keyarr++} src={e[counter].src} style={{height: '100px'}} alt="" title=""/>);
      }
    }
    return (imgArr);
  }

  /* ----------------------------------------------------
     To display the rate chart across Session categories.
     --------------------------------------------------- */
  chargeTable(types, numberOfRates) {
    const process = [];
    let keyVal = 0;
    for (let counter = 0; counter < numberOfRates; counter++) {
      process.push(<div key={keyVal++} className="uk-width-1-3 g-t"><span key={keyVal++}>{types[counter].name}</span><span key={keyVal++}><strong>{types[counter].price}</strong> perhour</span></div>);
    }
    return (process);
  }

  /* ------------------------------
     To display the Awards list.
     ------------------------------ */
  renderAwards(awardsArray) {
    const awdRender = [];
    let keyVal = 0;
    for (let counter = 0; counter < awardsArray.length; counter++) {
      awdRender.push(<li key={keyVal++}><span key={keyVal++} className="black-circle"><i key={keyVal++} className="fa fa-star" aria-hidden="true"/></span>{awardsArray[counter]}</li>);
    }
    return (awdRender);
  }

  /* ------------------------------
     To display the certifications list.
     ------------------------------ */
  renderCerties(certArray) {
    const certRender = [];
    if (certArray && certArray.length) {
      for (let counter = 0; counter < certArray.length; counter++) {
        certRender.push(<li key={counter}><span key={counter} className="black-circle"><i key={counter} className="fa fa-star" aria-hidden="true"/></span>&nbsp;{certArray[counter]}</li>);
      }
    }
    return (certRender);
  }

  /* ------------------------------
     To display the Training and Pricing list.
     ------------------------------ */
  renderTraningAndPricing(pricingArray) {
    const certRender = [];
    const trainingTypes = this.props.pricePerSession && this.props.pricePerSession.trainingTypes ? this.props.pricePerSession.trainingTypes : [];
    certRender.push(this.handleCoachingAndTrainingPrices(trainingTypes));
    return (certRender);
  }
  /* -----------------------
     Generate Slideshow list
     ----------------------- */
  handleSlides(e) {
    const imgArr = [];
    let keyVal = 0;
    if (e) {
      for (let counter = 0; counter < e.length; counter++) {
        imgArr.push(<li key={keyVal++}><img src={e[counter].src} height="100%" alt="" title="" style={{maxHeight: '226px', maxWidth: '402px', borderRadius: '10px', border: '0px'}}/></li>);
      }
    }
    return (imgArr);
  }
  /* Nuka-Carousel Functions and Classes */
  handleCarouSlide(imgArr) {
    const dispArr = [];
    let keyVal = 0;
    for (let i = 0; i < imgArr.length; i++) {
      dispArr.push(<img key={keyVal++} src={imgArr[i].src} alt={'Image ' + i} width="100%" style={{verticalAlign: 'middle', align: 'center', maxWidth: '402px', maxHeight: '226px', borderRadius: '8px'}}/>);
    }
    return (dispArr);
  }

